/test.dcphotobooths.com:8085/41-autosave/',0,'revision','',0),(46,1,'2012-01-15 02:19:01','2012-01-15 02:19:01','<?php\r\n\r\n  /**\r\n  *@desc A page. See single.php is for a blog post layout.\r\n  */\r\n\r\n  get_header();\r\n\r\n  if (have_posts()) : while (have_posts()) : the_post();\r\n  ?>\r\n\r\n    <div id=\"post-<?php the_ID(); ?>\"  <?php post_class(\'postWrapper\'); ?>>\r\n\r\n      <h1 class=\"postTitle\"><a href=\"<?php the_permalink() ?>\" rel=\"bookmark\"><?php the_title(); ?></a></h1>\r\n        \r\n      <div class=\"post\"><?php the_content(__(\'(more...)\')); ?></div>\r\n      <?php wp_link_pages(\'before=<p class=\"page-link\">&after=</p>&next_or_number=number&pagelink=page %\'); ?>\r\n      <p class=\"postMeta\"><?php edit_post_link(__(\'Edit\'), \'\'); ?></p>\r\n    </div>\r\n\r\n  <?php\r\n  \r\n\r\n  endwhile; else: ?>\r\n\r\n    <p>Sorry, no pages matched your criteria.</p>\r\n\r\n<?php\r\n  endif;\r\n\r\n  get_footer();\r\n?>\r\n','Blog','','inherit','open','open','','41-revision-3','','','2012-01-15 02:19:01','2012-01-15 02:19:01','',41,'http://test.dcphotobooths.com:8085/41-revision-3/',0,'revision','',0),(28,1,'2012-01-15 01:19:30','2012-01-15 01:19:30','<h1 class=\"postTitle page\">packages</h1>\r\n<div class=\"rates-section left\">\r\n<h1 class=\"rates-section-header\">basic package</h1>\r\n<div class=\"rates-section-body\">\r\nThe DC Photobooth basic package includes:\r\n<ul class=\"package-details\">\r\n<li>Prompt delivery and set up of booth</li>\r\n<li>1-2 professional booth attendants on-site for duration of the rental</li>\r\n<li>4 hours of unlimited 4-Pose (Black and White or Color) 4” x 6” single prints</li>\r\n<li>3 curtain color options (black, red, creme)</li>\r\n<li>Loads of fun props (we do take requests as well!)</li>\r\n<li>Customizable header/footer design on prints</li>\r\n<li>Customizable electronic slideshow on outer LCD</li>\r\n<li>Following the event, we will host the images in a secure location online (private user name and password will be provided)</li>\r\n<li>1 CD or flash drive with all photos</li>\r\n<ul>\r\n</div>\r\n</div>\r\n<div class=\"rates-section right\">\r\n<h1 class=\"rates-section-header\">available upgrades</h1>\r\n<div class=\"rates-section-body\">\r\nThe following upgrades are also available:\r\n<ul class=\"package-details\">\r\n<li>Double photo prints</li>\r\n<li>Guestbook for guests to leave photos and a note</li>\r\n<ul>\r\n</div>\r\n<img src=\"http://staging.dc-photobooth.com/wp-content/uploads/2012/01/guestbook-2-200x300.jpg\" alt=\"DC Photobooth Guest Book\" title=\"DC Photobooth Guest Book\" width=\"200\" height=\"300\" class=\"alignnone size-medium wp-image-148 postimg\" />\r\n</div>','Packages','','publish','open','closed','','photobooth-packages','','','2012-02-18 07:25:49','2012-02-18 07:25:49','',0,'http://test.dcphotobooths.com:8085/?page_id=28',2,'page','',0),(9,1,'2012-01-13 04:09:11','2012-01-13 04:09:11','<h1 class=\"postTitle page\">send us a message!</h1>\r\n<div id=\"contact-form-container\"><form id=\"contact-form\" class=\"contact-form\" action=\" \" method=\"post\">\r\n<div id=\"contact-form-left\"><label class=\"iconic user\" for=\"username\"> Name <span class=\"required\">*</span></label><input id=\"username\" type=\"text\" name=\"username\" placeholder=\"What can we call you?\"/>\r\n<br />\r\n<label class=\"iconic mail-alt\" for=\"usermail\"> E-mail address <span class=\"required\">*</span></label><input id=\"usermail\" type=\"email\" name=\"usermail\" placeholder=\"Trust me, we hate spam as much as you do.\" />\r\n<br />\r\n<label class=\"iconic link\" for=\"usersite\"> Website </label><input id=\"usersite\" type=\"url\" name=\"usersite\" placeholder=\"Have a wedding or event website?\"/>\r\n<br />\r\n<label class=\"iconic date\" for=\"userdate\"> Event Date </label><input id=\"userdate\" type=\"date\" name=\"userdate\" placeholder=\"When is this all going down?\"/>\r\n\r\n</div>\r\n<div id=\"contact-form-right\"><label class=\"iconic quote-alt\" for=\"subject\"> Subject </label><input id=\"subject\" type=\"text\" name=\"subject\" placeholder=\"What\'s this all about?\" />\r\n<br />\r\n<label class=\"iconic comment\" for=\"message\"> Message <span class=\"required\">*</span></label>\r\n<textarea placeholder=\"Don\'t be shy!  Tell us a little bit about your event, what you\'re looking for from a photobooth company, or just be nice and say hi!\" id=\"message\"></textarea>\r\n\r\n</div>\r\n<div style=\"clear: both;\"></div>\r\n<p class=\"indication\">All fields with a <span class=\"required\">*</span> are required</p>\r\n<input type=\"submit\" value=\" ★  Send the mail !\" />\r\n\r\n</form></div>','Contact Us','','publish','open','closed','','contact','','','2012-02-18 05:49:15','2012-02-18 05:49:15','',0,'http://test.dcphotobooths.com:8085/?page_id=9',7,'page','',0),(40,1,'2012-01-13 06:00:52','2012-01-13 06:00:52','[caption id=\"attachment_16\" align=\"aligncenter\" width=\"225\" caption=\"Introducing the DC Photobooth Booth\"]<a title=\"dc photobooth \" href=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/01/Booth-Mock-up.jpg\"><img class=\" wp-image-16 \" title=\"The DC Photobooth Booth\" src=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/01/Booth-Mock-up-225x300.jpg\" alt=\"dc photobooth\" width=\"225\" height=\"300\" /></a>[/caption]','The Booth','','inherit','open','open','','15-revision-7','','','2012-01-13 06:00:52','2012-01-13 06:00:52','',15,'http://test.dcphotobooths.com:8085/15-revision-7/',0,'revision','',0),(13,1,'2012-01-13 04:09:11','2012-01-13 04:09:11','','Contact Us','','inherit','open','open','','9-revision-2','','','2012-01-13 04:09:11','2012-01-13 04:09:11','',9,'http://test.dcphotobooths.com:8085/9-revision-2/',0,'revision','',0),(121,1,'2012-02-02 03:54:24','2012-02-02 03:54:24','','Joe','','inherit','open','open','','119-revision-2','','','2012-02-02 03:54:24','2012-02-02 03:54:24','',119,'http://test.dcphotobooths.com:8085/blog/119-revision