obooths.com:8085/blog/33-revision-2/',0,'revision','',0),(201,1,'2012-02-16 18:56:26','2012-02-16 18:56:26','<h1 class=\"postTitle page\">rates</h1>\r\n<div class=\"rates-section left\">\r\n<h1 class=\"rates-section-header\">basic package</h1>\r\n<div class=\"rates-section-body\">\r\nThe DC Photobooth basic package includes:\r\n<ul class=\"package-details\">\r\n<li>Prompt delivery and set up of booth</li>\r\n<li>1-2 professional booth attendants on-site for duration of the rental</li>\r\n<li>4 hours of unlimited 4-Pose (Black and White or Color) 4” x 6” single prints</li>\r\n<li>3 curtain color options (black, red, creme)</li>\r\n<li>Loads of fun props (we do take requests as well!)</li>\r\n<li>Customizable header/footer design on prints</li>\r\n<li>Customizable electronic slideshow on outer LCD</li>\r\n<li>Following the event, we will host the images in a secure location online (private user name and password will be provided)</li>\r\n<li>1 CD or flash drive with all photos</li>\r\n<ul>\r\n</div>\r\n</div>\r\n<div class=\"rates-section right\">\r\n<h1 class=\"rates-section-header\">available upgrades</h1>\r\n<div class=\"rates-section-body\">\r\nThe following upgrades are also available:\r\n<ul class=\"package-details\">\r\n<li>Double photo prints</li>\r\n<li>Guestbook for guests to leave photos and a note</li>\r\n<ul>\r\n</div>\r\n<img src=\"http://staging.dc-photobooth.com/wp-content/uploads/2012/01/guestbook-2-200x300.jpg\" alt=\"DC Photobooth Guest Book\" title=\"DC Photobooth Guest Book\" width=\"200\" height=\"300\" class=\"alignnone size-medium wp-image-148 postimg\" />\r\n</div>','Rates','','inherit','open','open','','28-revision-6','','','2012-02-16 18:56:26','2012-02-16 18:56:26','',28,'http://test.dcphotobooths.com:8085/blog/28-revision-6/',0,'revision','',0),(202,1,'2012-02-17 06:39:39','2012-02-17 06:39:39','<h1 class=\"postTitle page\">meet dc photobooth</h1>\r\n<img src=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/02/all-1-682x1024.jpg\" alt=\"Meet DC Photobooth!\" title=\"DC Photobooth\" width=\"289\" height=\"434\" class=\"alignleft aboutusleft size-large wp-image-114 postimg\" />\r\n\r\n<div id=\"about-us-main\">DC Photobooth is owned and operated by 3 guys who really know the wedding industry. After years of working for the leading online wedding website, we decided to put to use our valuable experiences working first hand with brides and wedding pros to create a product that is not only the most advanced in the wedding field, but the most compatible for the party on the day you’ll never forget!\r\n\r\nCall us at 703.898.1702 or email us at <a href=\"mailto:info@dmvphotobooth.com\">info@dmvphotobooth.com</a> to tell us more about your event!\r\n</div>\r\n\r\n<div id=\"member-thumbs\">\r\n\r\n[caption id=\"memberimg1\" align=\"alignnone\" width=\"150\" caption=\"Paul Moore\" class=\"memberimg\"]<img src=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/02/paulmoore-150x150.jpg\" alt=\"Paul Moore - Supreme Emporer of DC Photobooth\" title=\"Paul Moore\" width=\"150\" height=\"150\" class=\"size-thumbnail wp-image-106 postimg memberimg\" />[/caption]\r\n\r\n[caption id=\"memberimg2\" align=\"alignnone\" width=\"150\" caption=\"Paul Gentile\" class=\"memberimg\"]<img src=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/01/DCPB_0015-150x150.jpg\" alt=\"Paul Gentile - Czar of DC Photobooth\" title=\"paulgentile\" width=\"150\" height=\"150\" class=\"size-thumbnail wp-image-93 postimg memberimg\" />[/caption]\r\n\r\n[caption id=\"memberimg3\" align=\"alignnone\" width=\"150\" caption=\"Joe Ruzzi\" class=\"memberimg\"]<img src=\"http://test.dcphotobooths.com:8085/wp-content/uploads/2012/02/joeruzzi-150x150.jpg\" alt=\"Joe Ruzzi - Captain of DC Photobooth\" title=\"Joe Ruzzi\" width=\"150\" height=\"150\" class=\"size-thumbnail wp-image-111 postimg memberimg\" />[/caption]\r\n\r\n</div>','About Us','','inherit','open','open','','67-revision-34','','','2012-02-17 06:39:39','2012