e that best suits your event. We can’t wait to work with you!</div>\n\n<div class=\"faq-question\">Is a deposit required to reserve a booth?</div>\n<div class=\"faq-answer\">Yes, we require a $100 deposit to reserve your booth for your event date. Your final payment is required one week before the date of your event.</div>\n\n<div class=\"faq-question\">What methods of payment are available?</div>\n<div class=\"faq-answer\">Right now we only accept cash, checks and PayPal.  Contact us for more details.</div>\n\n<div class=\"faq-question\">What if I have to cancel or reschedule my event?</div>\n<div class=\"faq-answer\">We will work with you to reschedule your photo booth rental upon availability.</div>\n\n<div class=\"faq-question\">Will there be someone at the event to make sure everything runs smoothly?</div>\n<div class=\"faq-answer\">We will be there to set up the photo booth before your events starts, and will remain on hand throughout your event to make sure everyone is having a great time and that the photobooth stays stocked and running smoothly.</div>\n\n<div class=\"faq-question\">Can we customize the printout design?</div>\n<div class=\"faq-answer\">Certainly! We highly suggest that you work with us to customize background and text that is displayed on your prints. Whether you want to use a logo, names and dates, or your favorite quote, we will do everything that we can to make it happen. Virtually anything is possible with the customization level of our prints.</div>\n\n<div class=\"faq-question\">Do we need any special kind of hookup or facilities, to set up the photobooth on-site?</div>\n<div class=\"faq-answer\">A normal AC power source is all that is needed, preferably within 10-20 feet.</div>\n\n<div class=\"faq-question\">Can we get a copy of the images taken by the digital photobooth on a disk?</div>\n<div class=\"faq-answer\">Yes all photobooth rentals include a CD or DVD of all the photos taken at high resolution.</div>\n\n<div class=\"faq-footer\">For any additional questions please call us at 703.898.1702 or <a href=\"/contact\">send us a message!</a> </div>\n\n\n</div>','FAQs','','inherit','open','open','','33-autosave','','','2012-02-18 07:15:54','2012-02-18 07:15:54','',33,'http://test.dcphotobooths.com:8085/33-autosave/',0,'revision','',0),(209,1,'2012-02-18 06:48:33','2012-02-18 06:48:33','<h1 class=\"postTitle page\">frequently asked questions</h1>','FAQs','','inherit','open','open','','33-revision-4','','','2012-02-18 06:48:33','2012-02-18 06:48:33','',33,'http://test.dcphotobooths.com:8085/33-revision-4/',0,'revision','',0),(210,1,'2012-02-18 06:53:49','2012-02-18 06:53:49','<h1 class=\"postTitle page\">frequently asked questions</h1>\r\n<div class=\"faq-main\">\r\n\r\n</div>','FAQs','','inherit','open','open','','33-revision-5','','','2012-02-18 06:53:49','2012-02-18 06:53:49','',33,'http://test.dcphotobooths.com:8085/33-revision-5/',0,'revision','',0),(211,1,'2012-02-18 06:54:27','2012-02-18 06:54:27','<h1 class=\"postTitle page\">frequently asked questions</h1>\r\n<div class=\"faq-main\">\r\n\r\n</div>','FAQs','','inherit','open','open','','33-revision-6','','','2012-02-18 06:54:27','2012-02-18 06:54:27','',33,'http://test.dcphotobooths.com:8085/33-revision-6/',0,'revision','',0),(212,1,'2012-02-18 06:59:10','2012-02-18 06:59:10','<h1 class=\"postTitle page\">frequently asked questions</h1>\r\n<div class=\"faq-main\">\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n<div class=\"faq-question\"></div>\r\n<div class=\"faq-answer\"></div>\r\n\r\n</div>','FAQs','','inherit','open